    methods
        
        function obj = resampleData(obj, target_fs)
            % function obj = resampleData(obj, target_fs)
            %
            % resample data to target_fs using greatest common divisor
            
            if strcmp(obj.dataDomain{1},'TIME')
            gComDiv = gcd(double(obj.fs), target_fs);
            p = double(target_fs / gComDiv);
            q = double(obj.fs / gComDiv);
            
            newData = zeros(size(obj.data,1), ceil(size(obj.data,2) * (p/q)), size(obj.data,3));
            for ii=1:size(obj.data,1)
               newData(ii,:,:) = resample(squeeze(obj.data(ii,:,:)),p,q);
            end
            
            obj.data = newData;
            obj.fs = target_fs;
            obj.taps = size(obj.data,2);
            else
                fprintf('Data must be in time domain in order to resample. Please apply method obj.toTime() first.');
            end
        end
        
        % Make a copy of the earo handle object.
        function obj_new = copy(obj)
            % Instantiate new object.
            obj_new = feval(class(obj));
            
            % Copy all non-hidden properties.
            hprop= properties(obj);
            for i = 1:length(hprop)
                obj_new.(hprop{i}) = obj.(hprop{i});
            end
        end
        
        function [dataID, azimuth, elevation] = closestIrSrc(obj, az_approx, el_approx)
            
            % [dataID, azimuth, elevation] = closestIr(obj, az_approx, el_approx)
            %
            % This method returns the ID number [dataID] of the closest
            % angle to [az_approx, el_approx] that is available
            % within the source grid. [azimuth] and [elevation] return
            % the corresponding closest fitting angles
            %
            
            
            if strcmp(obj.angles,'DEG')
                az_approx   = az_approx*pi/180;
                el_approx   = el_approx*pi/180;
                obj.shutUp  = true;
                objRAD      = setRAD(obj);
                quadrature  = getSrcQuadrature(objRAD);
            else
                quadrature  = getSrcQuadrature(obj);
            end
            
            [Xg,Yg,Zg]   = sph2cart(quadrature(:,1),quadrature(:,2)-pi/2,1);
            [Xp,Yp,Zp]   = sph2cart(az_approx,el_approx-pi/2,1);
            distances    = sqrt((Xg-Xp).^2+(Yg-Yp).^2+(Zg-Zp).^2);
            dataID       = find(distances == min(distances));
            dataID = dataID(1);
            azimuth      = obj.sourceGrid.azimuth(dataID);
            elevation    = obj.sourceGrid.elevation(dataID);
            
        end

