            % [dataID, azimuth, elevation] = closestIr(obj, az_approx, el_approx)
            %
            % This method returns the ID number [dataID] of the closest
            % angle to [az_approx, el_approx] that is available
            % within the receiver/mic grid. [azimuth] and [elevation] return
            % the corresponding closest fitting angles
            %
            
            
            if strcmp(obj.angles,'DEG')
                az_approx   = az_approx*pi/180;
                el_approx   = el_approx*pi/180;
                obj.shutUp  = true;
                objRAD      = setRAD(obj);
                quadrature  = getMicQuadrature(objRAD);
            else
                quadrature  = getMicQuadrature(obj);
            end
            
            [Xg,Yg,Zg]   = sph2cart(quadrature(:,1),quadrature(:,2)-pi/2,1);
            [Xp,Yp,Zp]   = sph2cart(az_approx,el_approx-pi/2,1);
            distances    = sqrt((Xg-Xp).^2+(Yg-Yp).^2+(Zg-Zp).^2);
            dataID         = find(distances == min(distances));
            azimuth      = obj.micGrid.azimuth(dataID);
            elevation    = obj.micGrid.elevation(dataID);
            
        end
        
        function quadrature = getSrcQuadrature(obj)
            
            % quadrature = getQuadrature(obj)
            %
            % Returns the quadrature including azimuth and elevation
            % angles and weights.
            
            quadrature(:,1) = double(obj.sourceGrid.azimuth);
            quadrature(:,2) = double(obj.sourceGrid.elevation);
            if isempty(obj.sourceGrid.quadWeight)
                quadrature(:,3) = NaN;
            else
              quadrature(:,3) = double(obj.sourceGrid.quadWeight);
            end
            
        end
        
        function quadrature = getMicQuadrature(obj)
            
            % quadrature = getQuadrature(obj)
            %
            % Returns the quadrature including azimuth and elevation
            % angles and weights.
            
            quadrature(:,1) = double(obj.micGrid.azimuth);
            quadrature(:,2) = double(obj.micGrid.elevation);
            
        end
        
        function plotMics(obj)
            
            % plotMics(obj)
            %
            % Plot Nao's head with mic positions
            
            if obj.isRobot

                patch('vertices',obj.naoGeometry.vertices,'faces',obj.naoGeometry.faces,'facecolor',[0.7 0.8 0.7],'edgeColor','black','facelighting','phong');
                axis vis3d equal off;
                view ([144 4]);
                light('Position',[0 0 1],'Style','infinite');

                hold on;
                [X Y Z] = sph2cart(obj.micGrid.azimuth, pi/2-obj.micGrid.elevation, obj.micGrid.r);
                scatter3 (X,Y,Z,150*ones(size(X,1),1),'filled');
                hold off;

                title(['Microphone Positions in: ',strrep(obj.name,'_','-')]);
            
            else % regular grid
                
                obj.shutUp = true;
                obj        = setRAD(obj);
                quadrature = getMicQuadrature(obj);

                [x,y,z] = sph2cart(quadrature(:,1),pi/2-quadrature(:,2),1.01);

                colormap Gray;

                if size(x,1)>1500
                    plot3(x,y,z,'marker','.','markerfacecolor','g','color','g','linestyle','none')
                else
                    plot3(x,y,z,'marker','o','markerfacecolor','g','color','g','linestyle','none')
                end

                axis vis3d equal off; hold on; grid off; sphere; axis equal; rotate3d on; light;
                alpha(.6); lighting phong; hold off; set(gcf,'color','w');

                title(['Mic Positions in: ',strrep(obj.name,'_','-')]);
            end
            
        end
        
        function plotSources(obj)
            
            % plotQuad(obj)
            %
            % Shows a sphere plot of the quadrature
            
            obj.shutUp = true;
            obj        = setRAD(obj);
            quadrature = getSrcQuadrature(obj);
            
