        function obj = setDEG(obj)
            
            % obj = setDEG(obj)
            %
            % Changes the object's angle reference to DEG.
            % All angle handling is then in DEG.
            %
            % ! The default angle reference is RAD.
            
            if strcmp(obj.angles,'RAD');
                obj.angles    = 'DEG';
                obj.sourceGrid.azimuth   = obj.sourceGrid.azimuth*180/pi;
                obj.sourceGrid.elevation = obj.sourceGrid.elevation*180/pi;
                obj.micGrid.azimuth   = obj.micGrid.azimuth*180/pi;
                obj.micGrid.elevation = obj.micGrid.elevation*180/pi;
                if ~obj.shutUp
                    fprintf('Angle reference is now DEG.\n');
                end
            else
                if ~obj.shutUp
                    fprintf('Angle reference is DEG. (No Change)\n');
                end
            end
        end
        
        function obj = setRAD(obj) % Set Angles to RAD
            
            % obj = setRAD(obj)
            %
            % Changes the object's angle reference to RAD.
            % All angle handling is then in RAD.
            %
            % ! The default angle reference is RAD.
            
            if strcmp(obj.angles,'DEG');
                obj.angles    = 'RAD';
                obj.sourceGrid.azimuth   = obj.sourceGrid.azimuth*pi/180;
                obj.sourceGrid.elevation = obj.sourceGrid.elevation*pi/180;
                obj.micGrid.azimuth   = obj.micGrid.azimuth*pi/180;
                obj.micGrid.elevation = obj.micGrid.elevation*pi/180;
                if ~obj.shutUp
                    fprintf('Angle reference is now RAD.\n');
                end
            else
                if ~obj.shutUp
                    fprintf('Angle reference is RAD. (No Change)\n');
                end
            end
        end
        
        
        function dropWaveFile(obj, dataID, nBits, filename)
            
            % dropWaveFile(obj, dataID, nBits, filename)
            %
            % Drops a .WAV audio file containing the impulse
            % responses for a specific ID number [dataID].
            % The arguments bitdepht [nBits] and filename
            % [filename] are optional. The .wav file is multichannel file
            % for which each channel is the signal at its corresponding
            % micID
            %
            % Defaults:
            % ------------------------------------------------
            % nBits    = 16
            % filename = obj.name,'_IR',num2str(dataID), ...
            %            '-AZ',az, 'EL',num2str(el), ...
            %            obj.angles, [obj.headphone]
            % ------------------------------------------------
            % WARNING: NO DITHERING/NOISESHAPING APPLIED
            
            if nargin < 3
                nBits = 16;
            end
            
            if nargin < 4
                if strcmp(obj.angles,'RAD')
                    az = num2str(round(obj.sourceGrid.azimuth(dataID)*1e4));
                    el = num2str(round(obj.sourceGrid.elevation(dataID)*1e4));
                else
                    az = num2str(round(obj.sourceGrid.azimuth(dataID)*1e2));
                    el = num2str(round(obj.sourceGrid.elevation(dataID)*1e2));
                end
                filename = [obj.name,'_IR',num2str(dataID),'-AZ',az,'EL',num2str(el),obj.angles];
                
            end
            
            ir = squeeze(obj.data(dataID,:,:));
            
            if strcmp(obj.dataDomain{1},'TIME')
              wavwrite(ir, obj.fs, nBits, filename);
              if ~obj.shutUp
                fprintf(['Wave file has been written.\n']);
              end
            else
              if ~obj.shutUp, disp('Error. Data needs to be in time-domain to create a .wav file!'); end;
            end


            
        end
        
        function [finalAudio,fs] = playAudio(obj, dataID, audioSignal)
            
            % playAudio(obj, dataID, micID, audioSignal)
            %
            % Plays an audio signal convolved with the
            % impulse response(s) given by dataID, micID.
            % The method serves for a quick pre-listening
            % of the datasets. If the signal [audioSignal]
            % has more than one channel, the first channel
            % is taken.
            
            if size(audioSignal,2) > size(audioSignal,1)
                audioSignal = audioSignal';
            end
            
            audioSignal = audioSignal(:,1);
            ir          = squeeze(obj.data(dataID,:,:));
            if size(ir,2) > size(ir,1)
                ir = ir.';
            end
            
            finalAudio(:,1) = miro_fastConv(audioSignal,ir(:,1));
            finalAudio(:,2) = miro_fastConv(audioSignal,ir(:,2));

            if ~obj.shutUp
                fprintf('Playing audio ...\n');
            end
            finalAudio = 0.9 * finalAudio./max(abs(finalAudio(:)));
            fs = obj.fs;
            %soundsc(finalAudio, obj.fs);

            
            if ~obj.shutUp
                fprintf('... done.\n');
            end
            
        end
        
        function [obj, varargout]= toFreq(obj, nFFT)
            % function toFreq(obj, [nFFT])
            %
            % transform to frequency domain from time domain
            % [nFFT] - DFT size, optional
            %
            if nargin<2, 
                nFFT=size(obj.data,2); 
                if mod(nFFT,2), nFFT=nFFT+1; end;   % make sure it is even
            end;
            if strcmp(obj.dataDomain{1}, 'TIME')
                obj.data = fft(obj.data,nFFT,2);
                obj.dataDomain{1} = 'FREQ';               
               if nargout>1  %if rfequested by user, adding the frequency vector
                   varargout{1}=(0:(nFFT-1))*(obj.fs/nFFT);
               end              
            else
                if ~obj.shutUp, disp('Warning! Data already in frequency domain.'); end;
            end
        end

        
        function obj = toTime(obj, nFFT,cs_flag)
            % function toTime(obj, [nFFT])
            %
            % transform to time domain from frequency domain
            % [nFFT] - IDFT size, optional
            %
            % does not assume conjugate symmetry (not anymore)
            % O.B: added 'symmetric' ifft, it assume you provide only the
            % positive side of the fft frequncies
            %
            if nargin<3, cs_flag=false; end
            if cs_flag
                positive_f_bins = size(obj.data,2);
                nfft = 2*(positive_f_bins-1);
                obj.data(:,end+1 : nfft, :) = 0;
                obj.data = ifft(obj.data, [], 2, 'symmetric');
                %p_REF_t_omega = circshift(p_REF_t_omega, BSMobj.filt_samp / 2, 1);
                obj.taps = size(obj.data,2);
            else
                if nargin<2, nFFT=size(obj.data,2); end
                if strcmp(obj.dataDomain{1}, 'FREQ')
                    obj.data = ifft(obj.data,nFFT,2);
                    obj.dataDomain{1} = 'TIME';
                    if max(max(max(imag(obj.data)))) > 1e-14
                        if ~obj.shutUp, disp ('Warning! Non-zero imaginary part. Taking only real part. Check your data.'); end;
                        max(max(max(imag(obj.data))))
                        obj.data = real(obj.data);
                    end
                    obj.data = real(obj.data);
                    obj.taps = size(obj.data,2);
                else
                    if ~obj.shutUp, disp('Warning! Data already in time domain.'); end;
                end
            end

            
        end
        
        function obj = toSpace(obj, dim, th, ph)
            % function obj = toSpace(obj, dim, [th, ph])
            %
            % transform data from SH domain to space domain
            %   dim       - transformation dimension ('MIC' or 'SRC')
            %   [th, ph]  - optional elevation and azimuth vectors
            %               (if not specified then values from
            %               micGrid/sourcGrid are used)
            %
            
            if nargin < 3
                if ~obj.shutUp, disp ('Elevation and azimuth not specified. Using values from Source/Mic grid.'); end;
                if strcmp(dim,'MIC')
                    th = obj.micGrid.elevation;
                    ph = obj.micGrid.azimuth;
                elseif strcmp(dim,'SRC')
                
                    th = obj.sourceGrid.elevation;
                    ph = obj.sourceGrid.azimuth;
                else
                    if ~obj.shutUp, disp ('Invalid transformation dimension. Please specify "MIC" or "SRC"'); end;
                end                   
            end
            
            if strcmp(obj.dataDomain{2},'SH')
                Y=sh2(obj.orderN, th, ph);

                if strcmp(dim,'MIC')

                    % Iterate through sources
                    for nn=1:size(obj.data,1)
                        tmp(nn,:,:) = (squeeze(obj.data(nn,:,:))*Y);
                    end
                    obj.data = tmp;
                    obj.micGrid.elevation = th;
                    obj.micGrid.azimuth = ph;
                    obj.dataDomain{2} = 'SPACE';

                elseif strcmp(dim,'SRC')
                    % Iterate through mics
                    for nn=1:size(obj.data,3)
                        tmp(:,:,nn) = (squeeze(obj.data(:,:,nn)).'*Y).';
                    end
                    obj.data = tmp;
                    obj.sourceGrid.elevation = th;
                    obj.sourceGrid.azimuth = ph;
                    obj.dataDomain{2} = 'SPACE';

                else
                    if ~obj.shutUp, disp ('Invalid transformation dimension. Please specify "MIC" or "SRC"'); end;
                end
            else
                if ~obj.shutUp, disp ('Warning. Data already in space domain. Nothing done.'); end;
            end
        end
        
        function obj = toSH(obj, orderN, dim)
            % function obj = toSH(obj, orderN, dim)
            %
            % transform data to the spherical harmonics (SH) domain from
            % the space domain.
            %
            %  orderN    - transformation order
            %  dim       - transformation dimension ('MIC' or 'SRC')
            %
            if strcmp(obj.dataDomain{2}, 'SPACE')
                if strcmp(dim,'SRC')
                    
                    if ~obj.shutUp, fprintf('Transforming to SH over source grid, quadrature = %s\n',obj.sourceGrid.quadType); end;
                    


                    el = obj.sourceGrid.elevation;
                    az = obj.sourceGrid.azimuth;
                    Y = sh2(orderN, el, az);
                    if cond(Y) > 100
                        warning(['SH matrix condition number is above 100. ' 'Condition number = ' num2str(cond(Y),'%.2f')]);
                    end
                    if ~obj.shutUp, fprintf('Condition number = %.2f\n',cond(Y)); end; 
                    Yp=pinv(Y); 

% 
%                     if ~isempty(obj.sourceGrid.quadWeight)
%                         Yp = diag(obj.sourceGrid.quadWeight)*Y';
%                         test = Yp*Y;
%                     else
%                     end

                       
                    for nn=1:size(obj.data,3)       % iterate through mics
                        tmp(:,:,nn) = (double(squeeze(obj.data(:,:,nn)).')*Yp).';
                    end
                    obj.data = tmp;
                    obj.orderN = orderN;
                    obj.dataDomain{2} = 'SH';
                    
                    
                elseif strcmp(dim,'MIC')
                    % Perhaps change this to transformation using B?
                    if ~obj.shutUp
                        fprintf('Transforming to SH over mic grid, quadrature = %s\n',obj.micGrid.quadType);
                        if obj.isRobot
                          fprintf('-- This transformation assumes a spherical distribution of mics, but isRobot is true! --\n');
                        end
                    end
                    el = obj.micGrid.elevation;
                    az = obj.micGrid.azimuth;
                    if ~obj.shutUp, fprintf('Condition number = %.2f\n',cond(sh2(orderN, el, az))); end; 
                    Yp=pinv(sh2(orderN, el, az));    
                    for nn=1:size(obj.data,1)       % iterate through sources
                        tmp(nn,:,:) = (squeeze(obj.data(nn,:,:))*Yp);
                    end
                    obj.data = tmp;
                    obj.orderN = orderN;
                    obj.dataDomain{2} = 'SH';
                    
                else
                    if ~obj.shutUp, disp ('Invalid transformation dimension. Please specify "MIC" or "SRC"'); end;
                end
            else
                if ~obj.shutUp, disp('Warning! Data already in SH domain'); end;
            end
        end
        
        
    end
end


function ab = miro_fastConv(a,b)

% Internal use only

NFFT = size(a,1)+size(b,1)-1;
A    = fft(a,NFFT);
B    = fft(b,NFFT);
AB   = A.*B;
ab   = ifft(AB);

end

function Y = sh2(N,theta,phi)
    % Internal use only

    % complex constant
    j=sqrt(-1);

    % ensure sizes are correct
    if length(theta) ~= length(phi);
        fprintf('Lengths of theta and phi must be equal!');
        return;
    end;
    L=numel(theta);
    theta=reshape(theta,1,L); % make a row vector
    phi=reshape(phi,1,L);       % make a row vector


    %n=0
    Y=sqrt(1/(4*pi))*ones(1,L);

    for n=1:N,

        % positive m
        a=zeros(1,n);
        for m=0:n,
            a(m+1) = sqrt( ((2*n+1)/(4*pi)) * factorial(n-m) / factorial(n+m) );
        end;
        a=reshape(a,n+1,1);
        m=(0:n)';
        Y1 = (a*ones(1,L)) .* legendre(n,cos(theta)) .* exp(j*m*phi) ;

        % negative m
        m=(-n:-1)';
        Y2 = (((-1).^m)*ones(1,L)) .* conj(Y1(end:-1:2,:));

        % append to Y
        Y = [Y; Y2; Y1];

    end
end


